import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import ShowData from './components/ShowList';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path = '/' component = {ShowData}></Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
